ra, mankhwala ndi apamwamba-mapeto kukongola;
‚òÖ Pambuyo processing mankhwala popanda pinholes musati seepage, zambiri madzi ndi kutentha kwenikweni;
‚òÖ Kugwiritsiridwa ntchito kwa nkhungu yamaluwa mpukutu, nkhungu kuti ikhale yosavuta, ikhoza kusonkhanitsidwa kuchokera kumayendedwe osinthika ndi ovuta osapitirira komanso osakanikirana, komanso malinga ndi zosowa za makasitomala kuti apange mitundu yosiyanasiyana ya maluwa;
‚òÖ Chitsanzochi chikhoza kusinthidwa malinga ndi makhalidwe a makasitomala.

