Chidule
Metallized filimu pulsed (mphamvu yosungirako) capacitors akhoza mlandu kwa nthawi yaitali ndipo kumaliseche mu nthawi yaifupi kwambiri, chifukwa lalikulu mphamvu zimachitika. Mphamvu zimachitika analandira ndi mlandu zimachitika capacitor banki, amene analandira ndi yochepa oscillation kumaliseche kwa riyakitala chachikulu. The zimachitika capacitor banki ndi kulipiritsa chipangizo ndi mphamvu zochepa pamaso pa mayeso. Iwo wapatsidwa kwa nthawi yotalikirapo ndi oscillation kumaliseche a
... 
rako mphamvu makina kuwotcherera, etc .; DC mkulu-voteji zida, rectification ndi sefa chipangizo oscillation dera, mosalekeza zimachitika chipangizo mukamva voteji jenereta, inrush panopa jenereta, zimakhudza voteji wogawira Ndipo zipangizo zina sanali mosalekeza zimachitika.
