mfundo:

Hangzhou Intelligent Creative Technology Co, Ltd. (ICT) ndi fakitale wodziwika bwino pamakampani ochita zamagetsi ku China. Zogulitsa makamaka monga: mafakitale Maloboti, Makina ozipanga okha, Zodzipanga zokha
ICT nthawi zonse imatsatira mfundo zitatu izi: Anzeru oyendetsa mafakitale anzeru padziko lapansi, malingaliro opanga amaphatikizidwa mu kapangidwe kazinthu, Teknoloji imapangitsa kupanga mafakitale kukhala kosavuta.
Pali akatswiri opanga maukadaulo pafupifupi 20 pakampani ya ICT, onse omwe amachokera m'mabizinesi odziwika bwino opanga zida zamagetsi komanso mabungwe ofufuza za sayansi. Pazaka 15 zapitazi za ntchito za ICT, gulu laukadaulo lakula kuti lipereke chithandizo chamtundu wamtundu ndi ntchito zamagulu kumabizinesi opitilira 5,000. Mtsogolomo, makampani a ICT apitiliza kukulitsa magulu awo aukadaulo ndi kuthekera kopanga kuti athandizire anthu ena mabizinesi opanga zambiri.
-Mutisankhe
Zantchito zaka 1.15 zogwirira ntchito mwanzeru zamakampani
2. Makasitomala opitilira 5,000 padziko lonse lapansi ;
3. Zipitilira zopitilira 500 za zida zopewera miliri zaperekedwa kunja, ndikugwira ntchito yokhazikika komanso ntchito yabwino yogulitsa ;
4. Gulu lodzigulitsa lakunja lingathandize makasitomala kugula katundu wapamwamba wa China ;
5. Fakitale yodzikongoletsera yokhala ndi anthu opitilira 1,000, mtengo wotsika mtengo komanso zotsimikizika zake.

